import React from 'react'
import { BrowserRouter, Route } from 'react-router-dom'
import Home from '../pages/Home'
//componente funcional 

function Apps(){
    return (
        <BrowserRouter>
            <Route path="/home" component={Home}/>

            <Route path="/home/DrinkNew" component={Home}/>
        </BrowserRouter>

    )
}

export default Apps
